23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:1261:"Хочу выразить огромную благодарность Денисовой Валентине Михайловне и всему персоналу этой замечательной клиники:администраторам,медсёстрам.Приехали из Крыма по направлению,боялась ,что отношение будет предвзятое,но к счастью ошиблась.Валентина Михайловна профессионал своего дела,несмотря на свой молодой возраст.Сначала я переживала,не ошиблась ли с выбором врача,но после первого приёма все сомнения отпали сами собой.Мы были во многих клиниках Крыма и Москвы,но такого небезразличного отношения и огромного профессионализма не встречали нигде.Спасибо вам большое,я надеюсь у нас всё получится и мы приедем к вам ещё за детками.Вы подарили нам надежду и веру стать родителями!!!!!";s:4:"TYPE";s:4:"HTML";}s:25:"PROPERTY_MESSAGE_VALUE_ID";s:8:"23826:24";s:19:"PROPERTY_FILE_VALUE";a:0:{}s:17:"PROPERTY_PD_VALUE";s:1:"1";s:20:"PROPERTY_PD_VALUE_ID";s:8:"23826:26";s:24:"PROPERTY_LAST_NAME_VALUE";N;s:27:"PROPERTY_LAST_NAME_VALUE_ID";s:9:"23826:115";s:27:"PROPERTY_IS_MODERATED_VALUE";s:1:"1";s:30:"PROPERTY_IS_MODERATED_VALUE_ID";s:9:"23826:139";s:25:"PROPERTY_SHOW_ON_EN_VALUE";N;s:28:"PROPERTY_SHOW_ON_EN_VALUE_ID";s:9:"23826:612";s:25:"PROPERTY_FILE_DESCRIPTION";a:0:{}s:31:"PROPERTY_FILE_PROPERTY_VALUE_ID";a:0:{}s:10:"specialist";b:0;s:4:"file";a:0:{}}i:23714;a:24:{s:2:"ID";s:5:"23714";s:11:"ACTIVE_FROM";s:22:"23 августа 2016";s:9:"IBLOCK_ID";s:2:"12";s:19:"PROPERTY_NAME_VALUE";s:30:"Наталья и Сергей";s:22:"PROPERTY_NAME_VALUE_ID";s:8:"23714:21";s:20:"PROPERTY_EMAIL_VALUE";s:21:"natela-bor@rambler.ru";s:23:"PROPERTY_EMAIL_VALUE_ID";s:8:"23714:22";s:25:"PROPERTY_SPECIALIST_VALUE";i:19;s:28:"PROPERTY_SPECIALIST_VALUE_ID";s:8:"23714:23";s:22:"PROPERTY_MESSAGE_VALUE";a:2:{s:4:"TEXT";s:796:"Огромное человеческое, ничем не измеримое спасибо Меньшиковой Ирине Львовне и всему замечательному коллективу МЦРМ за то, что они творят чудеса и помогают мечтам стать явью! Благодаря профессионализму, таланту, терпению,пониманию и увереннос